import React, { Component,useState } from 'react';
import {Modal,Button,Form,FormControl} from 'react-bootstrap'

function CreateCollection() {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    const handleSubmit = () => {

    };

    collectionName = React.createRef();


    return (
      <>
        <Button variant="primary" onClick={handleShow}>
          Create Collection
        </Button>

        <Modal show={show} onHide={handleClose}>
          <Modal.Header closeButton>
            <Modal.Title>Create Collection</Modal.Title>
          </Modal.Header>

          <Modal.Body>
              <p>Collection Name</p>
              <Form inline>
                  <FormControl type="text" className="mr-sm-2" required ref={this.collectionName}/>
              </Form>
              <p>Start Year</p>
              <Form inline>
                  <FormControl type="text" className="mr-sm-2" placeholder="Start Year" />
              </Form>
              <p>End Year</p>
              <Form inline>
                  <FormControl type="text" className="mr-sm-2" placeholder="End Year"/>
              </Form>
          </Modal.Body>

          <Modal.Footer>
            <Button variant="secondary" onClick={handleClose}>
              Cancel
            </Button>
            <Button variant="primary" onClick={handleClose} onClick={handleSubmit}>
              Create
            </Button>
          </Modal.Footer>
        </Modal>
      </>
    );
  }

  export default CreateCollection;
